    await page.waitForSelector('input[type="radio"][value="male"]');
    await page.check('input[type="radio"][value="male"]');

    // Select date of birth
    await page.selectOption('select:nth-of-type(1)', '1'); // Month (January)
    await page.selectOption('select:nth-of-type(2)', '15'); // Day (15)
    await page.selectOption('select:nth-of-type(3)', '1990'); // Year (1990)

    // Take a screenshot after filling the form
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_form.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_form.png'));

    // Submit the sign-up form
    await page.click('button.create-btn');

    // Wait for the navigation after form submission
    await page.waitForLoadState('networkidle');

    // Take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_final.png'));

    return {
      success: true,
      action: "Successfully filled out and submitted the sign-up form.",
      extractedData: {
        name: 'John Doe',
        email: 'john.doe@example.com'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

